import React from 'react';
import {NavStyle, NavContainer} from '../styled/theme';
import {useSelector} from 'react-redux';
const Navbar = () => {

	return(
		<NavStyle>
			<NavContainer>
				<li className="logo">TravelStory</li>
				<li>Home</li>
				<li>Profile</li>
				<li>Search</li>
				<li>Logout</li>
			</NavContainer>
		</NavStyle>);
};

export default Navbar;
